  if ($btn.hasClass('disabled')) {
    return
  }

  const id = $btn.attr('data-id')

  await FoxfordService.user.pushEvent({ action: 'conversion', label: 'coach' })
  await pendingActions.addCartItem('coach_lesson', 'coach_product', Number(id))

  redirectToCheckout()
}


